import React from "react";

const Skills = () => {
  return (
    <div className="main">
      <div className="skills">
        <h1>Skills</h1>
        <p>
          Hammock letterpress prism dreamcatcher truffaut shabby chic vice
          cold-pressed. Franzen pug fashion axe before they sold out, tumblr
          irony kogi actually af bushwick banh mi. Snackwave bicycle rights tofu
          dreamcatcher tote bag pour-over meditation raw denim fanny pack.
          Pop-up retro taiyaki meditation twee gastropub VHS etsy. Semiotics
          gochujang street art normcore, edison bulb farm-to-table pour-over
          taxidermy brooklyn.
        </p>
      </div>
    </div>
  );
};

export default Skills;
